"""
Given an array of strings products and a string searchWord. We want to design a system that suggests at most three
product names from products after each character of searchWord is typed. Suggested products should have common prefix
with the searchWord. If there are more than three products with a common prefix return the three lexicographically
minimums products.
Return list of lists of the suggested products after each character of searchWord is typed.

Example 1:
    Input: products = ["mobile","mouse","moneypot","monitor","mousepad"], searchWord = "mouse"
    Output: [
    ["mobile","moneypot","monitor"],
    ["mobile","moneypot","monitor"],
    ["mouse","mousepad"],
    ["mouse","mousepad"],
    ["mouse","mousepad"]
    ]
    Explanation: products sorted lexicographically = ["mobile","moneypot","monitor","mouse","mousepad"]
    After typing m and mo all products match and we show user ["mobile","moneypot","monitor"]
    After typing mou, mous and mouse the system suggests ["mouse","mousepad"]
Example 2:
    Input: products = ["havana"], searchWord = "havana"
    Output: [["havana"],["havana"],["havana"],["havana"],["havana"],["havana"]]
Example 3:
    Input: products = ["bags","baggage","banner","box","cloths"], searchWord = "bags"
    Output: [["baggage","bags","banner"],["baggage","bags","banner"],["baggage","bags"],["bags"]]
Example 4:
    Input: products = ["havana"], searchWord = "tatiana"
    Output: [[],[],[],[],[],[],[]]

Constraints:
    1 <= products.length <= 1000
    There are no repeated elements in products.
    1 <= Σ products[i].length <= 2 * 10^4
    All characters of products[i] are lower-case English letters.
    1 <= searchWord.length <= 1000
    All characters of searchWord are lower-case English letters.
Hint #1
    Brute force is a good choice because length of the string is ≤ 1000.
Hint #2
    Binary search the answer.
Hint #3
    Use Trie data structure to store the best three matching. Traverse the Trie.
"""
from typing import List
import heapq


class TrieNode:
    def __init__(self, child):
        self.char = child[0] if child != "" else ""
        self.children = {}
        self.word_end = False
        # if child[1:]:
        self.add_child(child[1:])

    def add_child(self, child):
        if child == "":
            self.word_end = True
            return
        if child[0] not in self.children:
            self.children[child[0]] = TrieNode(child)
        elif child[1:]:
            self.children[child[0]].add_child(child[1:])

    def find_strings(self,child):
        if child != "":
            if child[0] not in self.children:
                return []
            results = self.children[child[0]].find_strings(child[1:])
            if results == []:
                return []
            for i in range(len(results)):
                results[i] = results[i] + [self.char]
            return results[:3]
            # return results[:3] if not self.word_end else [[self.char]] + results[:3]

        else:
            if self.children:
                results = []
                for i in range(97, 123):
                    if len(results) > 2:
                        break
                    if chr(i) in self.children:
                        results.extend(self.children[chr(i)].find_strings(""))
                for i in range(len(results)):
                    results[i] = results[i] + [self.char]
                # print(results)
                if self.word_end:
                    results = [[self.char]] + results

                return results[:3] #if not self.word_end else sorted([[self.char]] + results[:3])

            else:
                return [[self.char]]


class Solution:
    def bulid_trie(self, words):
        self.trie = TrieNode("")
        self.trie.word_end = False
        for word in words:
            self.trie.add_child(word)

    def suggestedProducts(self, products: List[str], searchWord: str) -> List[List[str]]:
        self.bulid_trie(products)
        results = []

        for i in range(len(searchWord)):
            word = searchWord[:i + 1]
            r = self.trie.find_strings(word)
            for j in range(len(r)):
                r[j] = "".join(r[j][::-1])
            results.append(r)

        return results

